import React from 'react';
import { Link } from 'react-router-dom';

const AdminNavbar = () => {
    return (
        <nav style={{ backgroundColor: '#4CAF50', color: '#fff', padding: '10px' }}>
            <h3>Admin Dashboard</h3>
            <ul style={{ listStyle: 'none', display: 'flex', gap: '20px' }}>
                <li><Link to="/admin" style={{ color: '#fff' }}>Home</Link></li>
                <li><Link to="/admin/artists" style={{ color: '#fff' }}>Manage Artists</Link></li>
                <li><Link to="/admin/bookings" style={{ color: '#fff' }}>Manage Bookings</Link></li>
                <li><Link to="/logout" style={{ color: '#fff' }}>Logout</Link></li>
            </ul>
        </nav>
    );
};

export default AdminNavbar;
